create or alter procedure sp_SaveMLParameter(
	@APPLICATION_ID						uniqueidentifier,
	@AMOUNT_NON_REFINANCING				money,
	@AMOUNT_REFINANCING					money,
	@LOAN_USAGE_CODE					nvarchar(2),
	@AGE								tinyint,
	@UNSECURED_REMAINDER_OTHER_BANKS	money,
	@MONTHLY_REPAYMENT					money,
	@IN_TURN 							money,
	@OUT_TURN							money
)
AS
	BEGIN TRANSACTION
	BEGIN TRY
		delete from ML_PARAMETER where APPLICATION_ID=@APPLICATION_ID
		insert into ML_PARAMETER
			(APPLICATION_ID,AMOUNT_NON_REFINANCING,AMOUNT_REFINANCING,LOAN_USAGE_CODE,AGE,UNSECURED_REMAINDER_OTHER_BANKS,MONTHLY_REPAYMENT,IN_TURN,OUT_TURN)
		values
			(@APPLICATION_ID,@AMOUNT_NON_REFINANCING,@AMOUNT_REFINANCING,@LOAN_USAGE_CODE,@AGE,@UNSECURED_REMAINDER_OTHER_BANKS,@MONTHLY_REPAYMENT,@IN_TURN,@OUT_TURN)
	END TRY
	BEGIN CATCH
		ROLLBACK TRANSACTION
		declare @ErrorMessage varchar(4000)
		set @ErrorMessage = ERROR_MESSAGE()
		RAISERROR (@ErrorMessage, 17, 1)
		RETURN
	END CATCH
	COMMIT TRANSACTION
GO

create or alter procedure sp_SaveMLResult(
	@APPLICATION_ID	uniqueidentifier,
	@SERVICE_RESULT	varchar(max)
)
AS
	SET NOCOUNT ON

	BEGIN TRANSACTION
	BEGIN TRY
		delete from ML_RESULT where APPLICATION_ID=@APPLICATION_ID
		insert into ML_RESULT
			(APPLICATION_ID,IS_REFINANCING,PD,AMOUNT)
		select @APPLICATION_ID
			,convert(bit,case JSON_VALUE(value, '$.option') when 1 then 0 else 1 end) as IS_REFINANCING
			,convert(money,JSON_VALUE(value, '$.pd')) as PD
			,convert(money,JSON_VALUE(value, '$.amount')) as AMOUNT
		from
		(
			SELECT value FROM OpenJson(@SERVICE_RESULT)
		) as X
	END TRY
	BEGIN CATCH
		ROLLBACK TRANSACTION
		declare @ErrorMessage varchar(4000)
		set @ErrorMessage = ERROR_MESSAGE()
		RAISERROR (@ErrorMessage, 17, 1)
		RETURN
	END CATCH
	COMMIT TRANSACTION
GO
